import React, { useState } from 'react';
import './Navbar.css'

export default function Navbar() {
  const [showBasic, setShowBasic] = useState(false);
 

  return (
    <nav class="navbar">
  <ul>
    <li><a href="#">Home</a></li>
    <li><a href="#">About</a></li>
    <li><a href="#">Services</a></li>
    <li><a href="#">Contact</a></li>
  </ul>
</nav>

  );
}
